import React from'react';
import { BrowserRouter,Route,Routes,Link } from'react-router-dom';
import Home from './Home';
function Header () {
    return (
        <div className="flex justify-between bg-primary p-4">
            <h1 className="text-3xl font-bold ">Elixer</h1>

            <BrowserRouter>
            <Routes>
                <Route path="/" element={<Home/>} />
            </Routes>
            </BrowserRouter>

            <ul className="pt-3">
                <li className="text-white">
                    <a  className="mx-3" href="/">Home</a>
                    <a  className="mx-3"href="/about">About</a>
                    <a  className="mx-3"href="/contact">Contact</a>
                    <a  className="mx-3"href="/login">Login</a>
                    <a  className="mx-3"href="/signup">Signup</a>
                </li>
            </ul>
        </div>
    )
}

export default Header;
